(6471, 76, '_assistant_items_0_number_assistant', 'field_68a10225c00c4'),
(6472, 76, 'assistant_items_0_text_assistant', 'Unser Team hat DocGaid so entwickelt, dass wir die Möglichkeit haben, sie an Deine Praxis und Dein Team anzupassen.'),
(6473, 76, '_assistant_items_0_text_assistant', 'field_68a10254686ac'),
(6474, 76, 'assistant_items_1_number_assistant', '02'),
(6475, 76, '_assistant_items_1_number_assistant', 'field_68a10225c00c4'),
(6476, 76, 'assistant_items_1_text_assistant', 'Wir gestalten Dir Deine Anamnese nicht nur in deutscher Sprache, sondern auch in Englisch oder Russisch. So fühlt sich jeder Patient willkommen.'),
