(6481, 76, '_assistant_items_2_text_assistant', 'field_68a10254686ac'),
(6482, 76, 'assistant_items_3_number_assistant', '04'),
(6483, 76, '_assistant_items_3_number_assistant', 'field_68a10225c00c4'),
(6484, 76, 'assistant_items_3_text_assistant', 'Das ist ein Riesen-Vorteil für Dich und Deine Assistenz, denn so musst Du Dich auf keine neue Dokumentation oder Unterlagen einstellen. Da Du Deine eigenen Schreiben mit einem Klick gebunden auf dem iPad findest, ermöglicht es Dir eine viel effektiveres, organisiertes und stressfreies Arbeiten.'),
