(6775, 206, '_assistant_items_0_number_assistant', 'field_68a10225c00c4'),
(6776, 206, 'assistant_items_0_text_assistant', 'Unser Team hat DocGaid so entwickelt, dass wir die Möglichkeit haben, sie an Deine Praxis und Dein Team anzupassen.'),
(6777, 206, '_assistant_items_0_text_assistant', 'field_68a10254686ac'),
(6778, 206, 'assistant_items_1_number_assistant', '02'),
(6779, 206, '_assistant_items_1_number_assistant', 'field_68a10225c00c4'),
(6780, 206, 'assistant_items_1_text_assistant', 'Wir gestalten Dir Deine Anamnese nicht nur in deutscher Sprache, sondern auch in Englisch oder Russisch. So fühlt sich jeder Patient willkommen.'),
(6781, 206, '_assistant_items_1_text_assistant', 'field_68a10254686ac'),
(6782, 206, 'assistant_items_2_number_assistant', '03'),
(6783, 206, '_assistant_items_2_number_assistant', 'field_68a10225c00c4'),
(6784, 206, 'assistant_items_2_text_assistant', 'Auf unseren Unterlagen fügen wir Dein Logo und Deine Initialen hinzu, oder wir binden Deine Dokumente nahtlos in die App nur für Dich mit ein.'),
(6785, 206, '_assistant_items_2_text_assistant', 'field_68a10254686ac'),
(6786, 206, 'assistant_items_3_number_assistant', '04'),
(6787, 206, '_assistant_items_3_number_assistant', 'field_68a10225c00c4'),
(6788, 206, 'assistant_items_3_text_assistant', 'Das ist ein Riesen-Vorteil für Dich und Deine Assistenz, denn so musst Du Dich auf keine neue Dokumentation oder Unterlagen einstellen. Da Du Deine eigenen Schreiben mit einem Klick gebunden auf dem iPad findest, ermöglicht es Dir eine viel effektiveres, organisiertes und stressfreies Arbeiten.'),
