(7114, 216, 'assistant_items_2_number_assistant', '03'),
(7115, 216, '_assistant_items_2_number_assistant', 'field_68a10225c00c4'),
(7116, 216, 'assistant_items_2_text_assistant', 'Auf unseren Unterlagen fügen wir Dein Logo und Deine Initialen hinzu, oder wir binden Deine Dokumente nahtlos in die App nur für Dich mit ein.'),
(7117, 216, '_assistant_items_2_text_assistant', 'field_68a10254686ac'),
(7118, 216, 'assistant_items_3_number_assistant', '04'),
(7119, 216, '_assistant_items_3_number_assistant', 'field_68a10225c00c4'),
(7120, 216, 'assistant_items_3_text_assistant', 'Das ist ein Riesen-Vorteil für Dich und Deine Assistenz, denn so musst Du Dich auf keine neue Dokumentation oder Unterlagen einstellen. Da Du Deine eigenen Schreiben mit einem Klick gebunden auf dem iPad findest, ermöglicht es Dir eine viel effektiveres, organisiertes und stressfreies Arbeiten.'),
