(8513, 241, '_assistant_items_0_number_assistant', 'field_68a10225c00c4'),
(8514, 241, 'assistant_items_0_text_assistant', 'Unser Team hat DocGaid so entwickelt, dass wir die Möglichkeit haben, sie an Deine Praxis und Dein Team anzupassen.'),
(8515, 241, '_assistant_items_0_text_assistant', 'field_68a10254686ac'),
(8516, 241, 'assistant_items_1_number_assistant', '02'),
(8517, 241, '_assistant_items_1_number_assistant', 'field_68a10225c00c4'),
(8518, 241, 'assistant_items_1_text_assistant', 'Wir gestalten Dir Deine Anamnese nicht nur in deutscher Sprache, sondern auch in Englisch oder Russisch. So fühlt sich jeder Patient willkommen.'),
(8519, 241, '_assistant_items_1_text_assistant', 'field_68a10254686ac'),
(8520, 241, 'assistant_items_2_number_assistant', '03'),
(8521, 241, '_assistant_items_2_number_assistant', 'field_68a10225c00c4'),
(8522, 241, 'assistant_items_2_text_assistant', 'Auf unseren Unterlagen fügen wir Dein Logo und Deine Initialen hinzu, oder wir binden Deine Dokumente nahtlos in die App nur für Dich mit ein.'),
(8523, 241, '_assistant_items_2_text_assistant', 'field_68a10254686ac'),
(8524, 241, 'assistant_items_3_number_assistant', '04'),
(8525, 241, '_assistant_items_3_number_assistant', 'field_68a10225c00c4'),
(8526, 241, 'assistant_items_3_text_assistant', 'Das ist ein Riesen-Vorteil für Dich und Deine Assistenz, denn so musst Du Dich auf keine neue Dokumentation oder Unterlagen einstellen. Da Du Deine eigenen Schreiben mit einem Klick gebunden auf dem iPad findest, ermöglicht es Dir eine viel effektiveres, organisiertes und stressfreies Arbeiten.'),
