(8902, 247, 'assistant_items_0_number_assistant', '01'),
(8903, 247, '_assistant_items_0_number_assistant', 'field_68a10225c00c4'),
(8904, 247, 'assistant_items_0_text_assistant', 'Unser Team hat DocGaid so entwickelt, dass wir die Möglichkeit haben, sie an Deine Praxis und Dein Team anzupassen.'),
(8905, 247, '_assistant_items_0_text_assistant', 'field_68a10254686ac'),
(8906, 247, 'assistant_items_1_number_assistant', '02'),
(8907, 247, '_assistant_items_1_number_assistant', 'field_68a10225c00c4'),
(8908, 247, 'assistant_items_1_text_assistant', 'Wir gestalten Dir Deine Anamnese nicht nur in deutscher Sprache, sondern auch in Englisch oder Russisch. So fühlt sich jeder Patient willkommen.'),
(8909, 247, '_assistant_items_1_text_assistant', 'field_68a10254686ac'),
(8910, 247, 'assistant_items_2_number_assistant', '03'),
(8911, 247, '_assistant_items_2_number_assistant', 'field_68a10225c00c4'),
(8912, 247, 'assistant_items_2_text_assistant', 'Auf unseren Unterlagen fügen wir Dein Logo und Deine Initialen hinzu, oder wir binden Deine Dokumente nahtlos in die App nur für Dich mit ein.'),
(8913, 247, '_assistant_items_2_text_assistant', 'field_68a10254686ac'),
(8914, 247, 'assistant_items_3_number_assistant', '04'),
(8915, 247, '_assistant_items_3_number_assistant', 'field_68a10225c00c4'),
(8916, 247, 'assistant_items_3_text_assistant', 'Das ist ein Riesen-Vorteil für Dich und Deine Assistenz, denn so musst Du Dich auf keine neue Dokumentation oder Unterlagen einstellen. Da Du Deine eigenen Schreiben mit einem Klick gebunden auf dem iPad findest, ermöglicht es Dir eine viel effektiveres, organisiertes und stressfreies Arbeiten.'),
