(8989, 247, '_faq_items_1_faq_question', 'field_68a1379a9a4e8'),
(8990, 247, 'faq_items_1_faq_answer', 'Ja, Nelly ist Dank seiner Schnittstellen mit jedem Praxisverwaltungssystem kompatibel. Mit Hilfe dieser Schnittstellen können Bilder und Dokumente direkt in der Patientenakte hinterlegt werden. Für mehr Informationen zur Schnittstellenkompatibilität Ihrer Praxissoftware und Nelly, empfehlen wir ein kostenfreies Beratungsgespräch mit einem unserer Nelly-Experten.'),
(8991, 247, '_faq_items_1_faq_answer', 'field_68a137a29a4e9'),
(8992, 247, 'faq_items_2_faq_question', 'Wie erreiche ich das DocGaid®-Team?'),
(8993, 247, '_faq_items_2_faq_question', 'field_68a1379a9a4e8'),
(8994, 247, 'faq_items_2_faq_answer', 'Ja, Nelly ist Dank seiner Schnittstellen mit jedem Praxisverwaltungssystem kompatibel. Mit Hilfe dieser Schnittstellen können Bilder und Dokumente direkt in der Patientenakte hinterlegt werden. Für mehr Informationen zur Schnittstellenkompatibilität Ihrer Praxissoftware und Nelly, empfehlen wir ein kostenfreies Beratungsgespräch mit einem unserer Nelly-Experten.'),
(8995, 247, '_faq_items_2_faq_answer', 'field_68a137a29a4e9'),
(8996, 247, 'faq_items_3_faq_question', 'Wie gestaltet sich die Zusammenarbeit mit DocGaid®?'),
(8997, 247, '_faq_items_3_faq_question', 'field_68a1379a9a4e8'),
