(9186, 252, 'text_doctors', 'Unsere Zahnärzte und Assistenten waren nicht sehr überzeugt von den Softwareprogrammen die auf dem Markt präsent waren. Daraufhin haben wir uns entschlossen, für unser Team selbst eine Software nach unseren Wünschen und angepasst an den Alltag zu kreieren. Angefangen mit einer sehr kleinen Idee wurde eine unglaubliche App entwickelt.'),
