(9299, 252, '_assistant_items_0_number_assistant', 'field_68a10225c00c4'),
(9300, 252, 'assistant_items_0_text_assistant', 'Unser Team hat DocGaid so entwickelt, dass wir die Möglichkeit haben, sie an Deine Praxis und Dein Team anzupassen.'),
(9301, 252, '_assistant_items_0_text_assistant', 'field_68a10254686ac'),
(9302, 252, 'assistant_items_1_number_assistant', '02'),
(9303, 252, '_assistant_items_1_number_assistant', 'field_68a10225c00c4'),
(9304, 252, 'assistant_items_1_text_assistant', 'Wir gestalten Dir Deine Anamnese nicht nur in deutscher Sprache, sondern auch in Englisch oder Russisch. So fühlt sich jeder Patient willkommen.'),
(9305, 252, '_assistant_items_1_text_assistant', 'field_68a10254686ac'),
(9306, 252, 'assistant_items_2_number_assistant', '03'),
(9307, 252, '_assistant_items_2_number_assistant', 'field_68a10225c00c4'),
(9308, 252, 'assistant_items_2_text_assistant', 'Auf unseren Unterlagen fügen wir Dein Logo und Deine Initialen hinzu, oder wir binden Deine Dokumente nahtlos in die App nur für Dich mit ein.'),
(9309, 252, '_assistant_items_2_text_assistant', 'field_68a10254686ac'),
(9310, 252, 'assistant_items_3_number_assistant', '04'),
(9311, 252, '_assistant_items_3_number_assistant', 'field_68a10225c00c4'),
(9312, 252, 'assistant_items_3_text_assistant', 'Das ist ein Riesen-Vorteil für Dich und Deine Assistenz, denn so musst Du Dich auf keine neue Dokumentation oder Unterlagen einstellen. Da Du Deine eigenen Schreiben mit einem Klick gebunden auf dem iPad findest, ermöglicht es Dir eine viel effektiveres, organisiertes und stressfreies Arbeiten.'),
