(10091, 254, '_assistant_items_1_number_assistant', 'field_68a10225c00c4'),
(10092, 254, 'assistant_items_1_text_assistant', 'Wir gestalten Dir Deine Anamnese nicht nur in deutscher Sprache, sondern auch in Englisch oder Russisch. So fühlt sich jeder Patient willkommen.'),
