(10095, 254, '_assistant_items_2_number_assistant', 'field_68a10225c00c4'),
(10096, 254, 'assistant_items_2_text_assistant', 'Auf unseren Unterlagen fügen wir Dein Logo und Deine Initialen hinzu, oder wir binden Deine Dokumente nahtlos in die App nur für Dich mit ein.'),
(10097, 254, '_assistant_items_2_text_assistant', 'field_68a10254686ac'),
(10098, 254, 'assistant_items_3_number_assistant', '04'),
(10099, 254, '_assistant_items_3_number_assistant', 'field_68a10225c00c4'),
(10100, 254, 'assistant_items_3_text_assistant', 'Das ist ein Riesen-Vorteil für Dich und Deine Assistenz, denn so musst Du Dich auf keine neue Dokumentation oder Unterlagen einstellen. Da Du Deine eigenen Schreiben mit einem Klick gebunden auf dem iPad findest, ermöglicht es Dir eine viel effektiveres, organisiertes und stressfreies Arbeiten.'),
