(10487, 255, '_assistant_image', 'field_68a1017db5d81'),
(10488, 255, 'practice_title', 'DocGaid passt sich Deiner Praxis an. Was heißt das genau?'),
(10489, 255, '_practice_title', 'field_68a1019d5dfc8'),
(10490, 255, 'assistant_items_0_number_assistant', '01'),
(10491, 255, '_assistant_items_0_number_assistant', 'field_68a10225c00c4'),
(10492, 255, 'assistant_items_0_text_assistant', 'Unser Team hat DocGaid so entwickelt, dass wir die Möglichkeit haben, sie an Deine Praxis und Dein Team anzupassen.'),
(10493, 255, '_assistant_items_0_text_assistant', 'field_68a10254686ac'),
(10494, 255, 'assistant_items_1_number_assistant', '02'),
(10495, 255, '_assistant_items_1_number_assistant', 'field_68a10225c00c4'),
(10496, 255, 'assistant_items_1_text_assistant', 'Wir gestalten Dir Deine Anamnese nicht nur in deutscher Sprache, sondern auch in Englisch oder Russisch. So fühlt sich jeder Patient willkommen.'),
(10497, 255, '_assistant_items_1_text_assistant', 'field_68a10254686ac'),
(10498, 255, 'assistant_items_2_number_assistant', '03'),
(10499, 255, '_assistant_items_2_number_assistant', 'field_68a10225c00c4'),
(10500, 255, 'assistant_items_2_text_assistant', 'Auf unseren Unterlagen fügen wir Dein Logo und Deine Initialen hinzu, oder wir binden Deine Dokumente nahtlos in die App nur für Dich mit ein.'),
(10501, 255, '_assistant_items_2_text_assistant', 'field_68a10254686ac'),
(10502, 255, 'assistant_items_3_number_assistant', '04'),
(10503, 255, '_assistant_items_3_number_assistant', 'field_68a10225c00c4'),
(10504, 255, 'assistant_items_3_text_assistant', 'Das ist ein Riesen-Vorteil für Dich und Deine Assistenz, denn so musst Du Dich auf keine neue Dokumentation oder Unterlagen einstellen. Da Du Deine eigenen Schreiben mit einem Klick gebunden auf dem iPad findest, ermöglicht es Dir eine viel effektiveres, organisiertes und stressfreies Arbeiten.'),
(10505, 255, '_assistant_items_3_text_assistant', 'field_68a10254686ac'),
