(10891, 256, '_assistant_image', 'field_68a1017db5d81'),
(10892, 256, 'practice_title', 'DocGaid passt sich Deiner Praxis an. Was heißt das genau?'),
(10893, 256, '_practice_title', 'field_68a1019d5dfc8'),
(10894, 256, 'assistant_items_0_number_assistant', '01'),
(10895, 256, '_assistant_items_0_number_assistant', 'field_68a10225c00c4'),
(10896, 256, 'assistant_items_0_text_assistant', 'Unser Team hat DocGaid so entwickelt, dass wir die Möglichkeit haben, sie an Deine Praxis und Dein Team anzupassen.'),
(10897, 256, '_assistant_items_0_text_assistant', 'field_68a10254686ac'),
(10898, 256, 'assistant_items_1_number_assistant', '02'),
(10899, 256, '_assistant_items_1_number_assistant', 'field_68a10225c00c4'),
(10900, 256, 'assistant_items_1_text_assistant', 'Wir gestalten Dir Deine Anamnese nicht nur in deutscher Sprache, sondern auch in Englisch oder Russisch. So fühlt sich jeder Patient willkommen.'),
(10901, 256, '_assistant_items_1_text_assistant', 'field_68a10254686ac'),
(10902, 256, 'assistant_items_2_number_assistant', '03'),
(10903, 256, '_assistant_items_2_number_assistant', 'field_68a10225c00c4'),
(10904, 256, 'assistant_items_2_text_assistant', 'Auf unseren Unterlagen fügen wir Dein Logo und Deine Initialen hinzu, oder wir binden Deine Dokumente nahtlos in die App nur für Dich mit ein.'),
(10905, 256, '_assistant_items_2_text_assistant', 'field_68a10254686ac'),
(10906, 256, 'assistant_items_3_number_assistant', '04'),
(10907, 256, '_assistant_items_3_number_assistant', 'field_68a10225c00c4'),
(10908, 256, 'assistant_items_3_text_assistant', 'Das ist ein Riesen-Vorteil für Dich und Deine Assistenz, denn so musst Du Dich auf keine neue Dokumentation oder Unterlagen einstellen. Da Du Deine eigenen Schreiben mit einem Klick gebunden auf dem iPad findest, ermöglicht es Dir eine viel effektiveres, organisiertes und stressfreies Arbeiten.'),
