(10987, 256, '_faq_items_2_faq_answer', 'field_68a137a29a4e9'),
(10988, 256, 'faq_items_3_faq_question', 'Wie gestaltet sich die Zusammenarbeit mit DocGaid®?'),
(10989, 256, '_faq_items_3_faq_question', 'field_68a1379a9a4e8'),
