(11371, 258, '_faq_title', 'field_68a137349a4e6'),
(11372, 258, 'faq_items_0_faq_question', 'Mit welchen Praxismanagement Systemen funktioniert DocGaid®?'),
(11373, 258, '_faq_items_0_faq_question', 'field_68a1379a9a4e8'),
(11374, 258, 'faq_items_0_faq_answer', 'Ja, Nelly ist Dank seiner Schnittstellen mit jedem Praxisverwaltungssystem kompatibel. Mit Hilfe dieser Schnittstellen können Bilder und Dokumente direkt in der Patientenakte hinterlegt werden. Für mehr Informationen zur Schnittstellenkompatibilität Ihrer Praxissoftware und Nelly, empfehlen wir ein kostenfreies Beratungsgespräch mit einem unserer Nelly-Experten.'),
(11375, 258, '_faq_items_0_faq_answer', 'field_68a137a29a4e9'),
