(11383, 258, '_faq_items_2_faq_answer', 'field_68a137a29a4e9'),
(11384, 258, 'faq_items_3_faq_question', 'Wie gestaltet sich die Zusammenarbeit mit DocGaid®?'),
(11385, 258, '_faq_items_3_faq_question', 'field_68a1379a9a4e8'),
