(11728, 260, 'partner_content', 'Wir glauben, dass jeder ein effizienteres, transparenteres und zugänglicheres Gesundheitssystem verdient. Indem wir auf Interoperabilität setzen und traditionelle Prozesse digitalisieren, entlasten wir das Fachpersonal und verbessern das Patientenerlebnis. Unsere Kooperationspartner unterstützen uns auf dieser Mission.Wir glauben, dass jeder ein effizienteres, transparenteres und zugänglicheres Gesundheitssystem verdient. '),
