(11766, 260, 'faq_title', 'Häufig gestellte Fragen'),
(11767, 260, '_faq_title', 'field_68a137349a4e6'),
(11768, 260, 'faq_items_0_faq_question', 'Mit welchen Praxismanagement Systemen funktioniert DocGaid®?'),
(11769, 260, '_faq_items_0_faq_question', 'field_68a1379a9a4e8'),
(11770, 260, 'faq_items_0_faq_answer', 'Ja, Nelly ist Dank seiner Schnittstellen mit jedem Praxisverwaltungssystem kompatibel. Mit Hilfe dieser Schnittstellen können Bilder und Dokumente direkt in der Patientenakte hinterlegt werden. Für mehr Informationen zur Schnittstellenkompatibilität Ihrer Praxissoftware und Nelly, empfehlen wir ein kostenfreies Beratungsgespräch mit einem unserer Nelly-Experten.'),
(11771, 260, '_faq_items_0_faq_answer', 'field_68a137a29a4e9'),
(11772, 260, 'faq_items_1_faq_question', 'Wie qualifiziert ist das Team für die Abrechnung hinter DocGaid®?'),
(11773, 260, '_faq_items_1_faq_question', 'field_68a1379a9a4e8'),
(11774, 260, 'faq_items_1_faq_answer', 'Ja, Nelly ist Dank seiner Schnittstellen mit jedem Praxisverwaltungssystem kompatibel. Mit Hilfe dieser Schnittstellen können Bilder und Dokumente direkt in der Patientenakte hinterlegt werden. Für mehr Informationen zur Schnittstellenkompatibilität Ihrer Praxissoftware und Nelly, empfehlen wir ein kostenfreies Beratungsgespräch mit einem unserer Nelly-Experten.'),
(11775, 260, '_faq_items_1_faq_answer', 'field_68a137a29a4e9'),
(11776, 260, 'faq_items_2_faq_question', 'Wie erreiche ich das DocGaid®-Team?'),
(11777, 260, '_faq_items_2_faq_question', 'field_68a1379a9a4e8'),
(11778, 260, 'faq_items_2_faq_answer', 'Ja, Nelly ist Dank seiner Schnittstellen mit jedem Praxisverwaltungssystem kompatibel. Mit Hilfe dieser Schnittstellen können Bilder und Dokumente direkt in der Patientenakte hinterlegt werden. Für mehr Informationen zur Schnittstellenkompatibilität Ihrer Praxissoftware und Nelly, empfehlen wir ein kostenfreies Beratungsgespräch mit einem unserer Nelly-Experten.'),
(11779, 260, '_faq_items_2_faq_answer', 'field_68a137a29a4e9'),
(11780, 260, 'faq_items_3_faq_question', 'Wie gestaltet sich die Zusammenarbeit mit DocGaid®?'),
(11781, 260, '_faq_items_3_faq_question', 'field_68a1379a9a4e8'),
(11782, 260, 'faq_items_3_faq_answer', 'Ja, Nelly ist Dank seiner Schnittstellen mit jedem Praxisverwaltungssystem kompatibel. Mit Hilfe dieser Schnittstellen können Bilder und Dokumente direkt in der Patientenakte hinterlegt werden. Für mehr Informationen zur Schnittstellenkompatibilität Ihrer Praxissoftware und Nelly, empfehlen wir ein kostenfreies Beratungsgespräch mit einem unserer Nelly-Experten.'),
(11783, 260, '_faq_items_3_faq_answer', 'field_68a137a29a4e9'),
(11784, 260, 'faq_items_4_faq_question', 'Kann ich DocGaid® unverbindlich ausprobieren?'),
(11785, 260, '_faq_items_4_faq_question', 'field_68a1379a9a4e8'),
(11786, 260, 'faq_items_4_faq_answer', 'Ja, Nelly ist Dank seiner Schnittstellen mit jedem Praxisverwaltungssystem kompatibel. Mit Hilfe dieser Schnittstellen können Bilder und Dokumente direkt in der Patientenakte hinterlegt werden. Für mehr Informationen zur Schnittstellenkompatibilität Ihrer Praxissoftware und Nelly, empfehlen wir ein kostenfreies Beratungsgespräch mit einem unserer Nelly-Experten.'),
