(12077, 261, '_assistant_image', 'field_68a1017db5d81'),
(12078, 261, 'practice_title', 'DocGaid passt sich Deiner Praxis an. Was heißt das genau?'),
(12079, 261, '_practice_title', 'field_68a1019d5dfc8'),
(12080, 261, 'assistant_items_0_number_assistant', '01'),
(12081, 261, '_assistant_items_0_number_assistant', 'field_68a10225c00c4'),
(12082, 261, 'assistant_items_0_text_assistant', 'Unser Team hat DocGaid so entwickelt, dass wir die Möglichkeit haben, sie an Deine Praxis und Dein Team anzupassen.'),
(12083, 261, '_assistant_items_0_text_assistant', 'field_68a10254686ac'),
(12084, 261, 'assistant_items_1_number_assistant', '02'),
(12085, 261, '_assistant_items_1_number_assistant', 'field_68a10225c00c4'),
(12086, 261, 'assistant_items_1_text_assistant', 'Wir gestalten Dir Deine Anamnese nicht nur in deutscher Sprache, sondern auch in Englisch oder Russisch. So fühlt sich jeder Patient willkommen.'),
(12087, 261, '_assistant_items_1_text_assistant', 'field_68a10254686ac'),
(12088, 261, 'assistant_items_2_number_assistant', '03'),
(12089, 261, '_assistant_items_2_number_assistant', 'field_68a10225c00c4'),
(12090, 261, 'assistant_items_2_text_assistant', 'Auf unseren Unterlagen fügen wir Dein Logo und Deine Initialen hinzu, oder wir binden Deine Dokumente nahtlos in die App nur für Dich mit ein.'),
(12091, 261, '_assistant_items_2_text_assistant', 'field_68a10254686ac'),
(12092, 261, 'assistant_items_3_number_assistant', '04'),
(12093, 261, '_assistant_items_3_number_assistant', 'field_68a10225c00c4'),
(12094, 261, 'assistant_items_3_text_assistant', 'Das ist ein Riesen-Vorteil für Dich und Deine Assistenz, denn so musst Du Dich auf keine neue Dokumentation oder Unterlagen einstellen. Da Du Deine eigenen Schreiben mit einem Klick gebunden auf dem iPad findest, ermöglicht es Dir eine viel effektiveres, organisiertes und stressfreies Arbeiten.'),
(12095, 261, '_assistant_items_3_text_assistant', 'field_68a10254686ac'),
